import { createGlobalStyle } from "styled-components";
import reset from "styled-reset";

export default createGlobalStyle`
  ${reset}

  * {
    box-sizing: border-box;
  }

  svg {
    cursor: pointer;

    &:hover {
      fill: #3897f0;
    }
  }

  .modal {
    display: flex !important;
  }
  .modal-dialog {
    flex: 1;
    margin: 10rem auto !important;
  }
  .modal-content {
    height: 100%;
  }
`;
